import React from "react";


const Slot =() => {
             const a=["üòö","üèπ","üåû"]
             const b=["üéà","üéà","üéà"]

            
     for(let i=0;i<a.length;i++){
 
        let r=Math.floor(Math.random()*3)
                    
                    let x=a[r]
     }

        for(let i=0;i<b.length;i++){
 
          let r=Math.floor(Math.random()*3)
                    let y=b[r]

                    let z=b[r]
            
        }
         
                 if(x===y && y===z){
                            return (
                                    <>
                                       <div className="slot+timer">
                                           <h1>
                                                 {x} {x} {z}
                                           </h1>
                                          <h1>This is matching</h1>
                                       </div>
            
            
                                    </>
                                   )
                 
                                }
            
    }
    export default Slot
